function openDropdown(e,t){const n=document.getElementsByClassName("dropdown-box");for(let e=0;e<n.length;e++)n[e].style.display="none";const o=document.getElementsByClassName("dropdown");for(let e=0;e<o.length;e++)o[e].className=o[e].className.replace(" active","");const s=document.getElementById(t);s&&(s.style.display="block"),e&&(e.currentTarget.className+=" active")}